import React from "react";
import {gradient, randomType} from "../../../services/gradient";
import {randomString} from "../../../services/gradient"

export const Post = props => {

    const bgGradient = { background: gradient(randomString(10), randomType(), 0.1)}

    return (
        <div className="post" style={bgGradient}>
            <time className="time" dateTime="2019-05-31">
                <span className="news__day">31</span>
                <span className="news__year">May 2019</span>
            </time>
            {props.title}
        </div>
    )
}
